import React from 'react';
import { request, setAuthHeader } from '../helpers/axios_helper';
import { withRouter } from 'react-router-dom'; // Importez withRouter pour accéder à l'historique de navigation

class AuthContent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: []
        }
    }

    componentDidMount() {
        request(
            "GET",
            "/messages",
            {}).then(
            (response) => {
                this.setState({data: response.data});
                // Redirigez vers la page de contact en cas de succès
                this.props.history.push('/contact');
            }).catch(
            (error) => {
                if (error.response.status === 401) {
                    setAuthHeader(null);
                } else {
                    this.setState({data: error.response.code})
                }
            }
        );
    }

    render() {
        return (
            <div className="row justify-content-md-center">
                <div className="col-3">
                    <div className="card" style={{width: "18rem"}}>
                        <div className="card-body">
                            <h5 className="card-title">Connexion</h5>
                            <ul>
                                Success ! 
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default withRouter(AuthContent); // Exportez le composant avec withRouter pour l'enrichir de l'historique de navigation
